    "# DeepDream algorithm with multi-scale processing\n",
    "import time\n",
    "start = time.time() #The time.time() function is used to record the start time. This can be helpful for measuring the duration of the DeepDream process\n",
    "\n",
    "OCTAVE_SCALE = 1.30 #OCTAVE_SCALE is a constant that determines the scale factor between consecutive octaves in the multi-scale processing. A value greater than 1.0 means that each octave is scaled up, and a smaller value means scaling down\n",
    "\n",
    "img = tf.constant(np.array(original_img)) #The original image (original_img) is converted to a NumPy array and then to a TensorFlow constant (img). This constant will be used as the starting point for the multi-scale DeepDream process.\n",
    "base_shape = tf.shape(img)[:-1] #The tf.shape function is used to obtain the shape of the image tensor. The [:-1] slicing is used to get all dimensions except the last one, which corresponds to the number of color channels. base_shape represents the base spatial dimensions of the image.\n",
    "float_base_shape = tf.cast(base_shape, tf.float32) #The base shape is cast to a float32 data type. This float version (float_base_shape) is used in subsequent operations where floating-point precision is required.\n",
    "\n",
    "for n in range(-2, 3): #This loop iterates over five different octaves (n ranges from -2 to 2).\n",
    "  new_shape = tf.cast(float_base_shape*(OCTAVE_SCALE**n), tf.int32) #For each octave, a new shape is calculated by scaling the base shape using the OCTAVE_SCALE constant. This new shape is cast to integer type.\n",
    "\n",
    "  img = tf.image.resize(img, new_shape).numpy() #The image is resized to the new shape using TensorFlow's tf.image.resize function. The result is converted to a NumPy array.\n",
    "\n",
    "  img = run_deep_dream_simple(img=img, steps=50, step_size=0.01) #The run_deep_dream_simple function is called on the resized image for 50 steps of optimization with a step size of 0.01.\n",
    "\n",
    "display.clear_output(wait=True)\n",
    "img = tf.image.resize(img, base_shape) #The output display is cleared, and the image is resized back to the original base shape.\n",
    "img = tf.image.convert_image_dtype(img/255.0, dtype=tf.uint8)\n",
    "show(img) #The image is converted to the appropriate data type and displayed. tf.image.convert_image_dtype is used to convert the image to a uint8 data type.\n",
    "\n",
    "end = time.time()\n",
    "end-start #The end time is recorded, and the total duration of the DeepDream process is calculated by subtracting the start time (end - start)."
